    false,nt"url": null,nt"notes": "This annual narrative report for Kenai
    NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, public participation, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, forests, fire management, pest control, and wilderness areas.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, shorebirds, raptors, game mammals, fisheries resources,
    wildlife propagation, marking and bird banding, and injured wildlife. The public
    uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, communication systems, computer systems, and energy conservation. Items
    of interest are provided at the end. Newspaper articles and a progress report for
    a study titled "Reintroduction, monitoring, and management of caribou (Rangifer
    tarandus) in the central and southern regions of the Kenai National Wildlife Refuge"
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
